import React, { Component } from 'react';
import LoginService from '../../services/LoginService';

class UserDashboardComponent extends Component {
  constructor(props) {
    super(props);
    this.state = {
      loggedIn: null
    }
    this.getHeader = this.getHeader.bind(this);

    LoginService.userLoggedIn().then(response => {
        this.state.loggedIn = response.data;
        if (!this.state.loggedIn) {  // string is false if it is empty, null, or undefined
          this.props.history.push("/");
        }
      }
    );
  }

  getHeader() {
    let userLoggedIn = this.state.userLoggedIn;
    if (!userLoggedIn) {
      return "Please wait";
    } else {
      return `Welcome ${userLoggedIn}!`;
    }
  }

  render() {
    return(
      <div className="userDashboard">
        <h1>{this.getHeader}</h1>
      </div>
    )
  }
};

export default UserDashboardComponent;
